import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Navbar } from 'react-bootstrap';
import Routes from './Routes';
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      leagues: []
    };
  }
  setName = name => {
    this.setState({
      name: name,
    });
  }
  setLeagues = leagues => {
    this.setState({
      leagues: leagues,
    });
  }
  render() {
    const childProps = {
      name: this.state.name,
      setName: this.setName,
      leagues: this.state.leagues,
      setLeagues: this.setLeagues
    };
    return (
      <div className="app-container">
        <Navbar bg="light" expand="lg">
          <Navbar.Brand>
            <Link to='/home' style={{ textDecoration: 'none' }}>FPL Stats</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
              Welcome <b>{this.state.name ? this.state.name : 'Unknown'}</b>
            </Navbar.Text>
          </Navbar.Collapse>
        </Navbar>
        <Routes childProps={childProps}/>
      </div>
    );
  }
}

export default App;
